import Footer from "../Componenets/Footer";
import Hero from "../Componenets/Hero";
import Navbar from "../Componenets/Navbar";

const About = () => {
  return (
    <>
      <Navbar />
      <Hero />
      <h3>About Page</h3>
      <Footer />
    </>
  );
};
export default About;
